import axios from "axios";
import React, { useEffect, useRef, useState } from "react";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Box } from '@mui/material';
import { InputSelect } from "./InputSelect";
import { numberWithCommas } from '../NFTs/PriceTable';

const getData = () => {
    return axios(`https://market-api.radiocaca.com/nft-sales?pageSize=1600&sortBy=fixed_price&order=asc&category=13&tokenId=-1`, {
        "Access- Control - Allow - Origin": "*"
    });
}

const getProperty = (id) => {
    return axios(`https://market-api.radiocaca.com/nft-sales/${id}`, {
        "Access-Control-Allow-Origin": "*"
    });
}
const Metamon = () => {
    const [lowestPrice, setLowestPrice] = useState([]);

    // const [highestScore, setHighestScore] = useState([]);
    // const [highestLevel, setHighestLevel] = useState([]);
    const tempList = useRef([])

    const getListMetamon = async () => {

        await getData().then(res => {
            const data = res.data.list;
            const lowest = data.sort((pre, cur) => {
                if (pre.fixed_price < cur.fixed_price) {
                    return 1;
                }
                return 0;
            })
            lowest.length = 10;

            tempList.current = [];
            const anyList = lowest.map((metamon) => {
                const getProp = async () => {
                    const { properties } = await getProperty(metamon.id).then(res => res.data.data)
                    const score = properties[4].value;
                    const level = properties[2].value;

                    return {
                        ...metamon,
                        score, level
                    }
                }
                return getProp();
            })
            const listMetamon = anyList.map((item) => item)
            console.log(listMetamon.length)
            setLowestPrice(listMetamon);
        });
    }
    useEffect(() => {
        getListMetamon();

        return () => {
            setLowestPrice([]);
        }
    }, [])
    return (
        <Box sx={{ textAlign: 'left' }}>
            <InputSelect />
            <TableContainer id='table-scroll' component={Paper}>
                <Table id='tablePrice' aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell align="center">#</TableCell>
                            <TableCell align="center">

                            </TableCell>
                            <TableCell align="center">
                                ID
                            </TableCell>
                            <TableCell align="center">
                                Score
                            </TableCell>
                            <TableCell align="center">
                                Level
                            </TableCell>
                            <TableCell align="center">
                                Price
                            </TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {lowestPrice && lowestPrice.map((metamon, index) => {
                            const getData = async () => {
                                const data = await metamon.then(res => res)
                                console.log(data)
                                return (
                                    <TableRow key={index + 1}>
                                        <TableCell align="center" component="th" scope="row">{index + 1}</TableCell>
                                        <TableCell align="center" component="th" scope="row">
                                            <a href={`https://market.radiocaca.com/#/market-place/${data.id}`} target='_blank' rel="noreferrer">

                                                <img width='50px' height='50px' src={metamon.image_url} alt='Metamon' />
                                            </a>
                                        </TableCell>
                                        <TableCell align="center" component="th" scope="row">
                                            <a href={`https://market.radiocaca.com/#/market-place/${metamon.id}`} target='_blank'
                                                style={{ color: '#363636', textDecoration: 'none' }}
                                                rel="noreferrer"
                                            >
                                                {metamon.token_id}</a></TableCell>
                                        <TableCell align="center" component="th" scope="row">{metamon.score}</TableCell>
                                        <TableCell align="center" component="th" scope="row">{metamon.level}</TableCell>
                                        <TableCell align="center" component="th" scope="row">{numberWithCommas(metamon.fixed_price)}</TableCell>
                                    </TableRow>
                                )
                            }
                            getData();

                        }
                        )}
                    </TableBody>
                </Table>
            </TableContainer>
        </Box>

    )
}

export default Metamon;
